def get_pixels(img_source):
   image_data = imread(img_source).astype(np.float32)
   return image_data

        
   
def organize(source):
   x = [] 
   im = Image.open(source,'r')
   im = im.convert('L')
   im = im.resize((28,28),Image.ANTIALIAS)   
   pix = im.getdata()
   arr_pix = []
   w, h = 28,28
   
   for s in range(0, w):
      arr_pix.append([])
      for c in range(0, h):
         arr_pix[s].append(pix.getpixel((s,c)))

   x.append(arr_pix)
   x = np.array(x).astype(np.float32)
   x /= 255.0
   
   return np.array(x) #shape (1,28,28)
   


def crop_out_lesion(source):
   image = cv2.imread(source,-1)
   image = cv2.cvtColor(image, cv2.COLOR_BGR2RGBA)
   pix = get_pixels(source)
   coords = []
   for i in range(0,pix.shape[0]):
      for c in range(0,pix.shape[1]):
         r = pix[i][c][2]
         b = pix[i][c][0]
         g = pix[i][c][1]
         if((r != g) and (r != b) and (g == 0) and (b == 0)): #only apply to first identified lesion
            coords.append([c,i])

   
   
   if(len(coords) == 0):
      return ""#render_template("status_update.html", msg="Did not work, image is not cropped")
         
   mask = np.zeros(image.shape, dtype=np.uint8)
   roi_corners = np.array([coords], dtype=np.int32)
 
   channel_count = image.shape[2] 
   ignore_mask_color = (255,)*channel_count
   cv2.fillPoly(mask, roi_corners, ignore_mask_color)
   
   lesion_with_border = cv2.bitwise_and(image, mask)
   
   #im = cv2.split(lesion_with_border)
   
   for i in range(0, lesion_with_border.shape[0]):
      for c in range(0, lesion_with_border.shape[1]):
         red = pix[i][c][2]
         green = pix[i][c][0]
         blue = pix[i][c][1]
         if((red != green) and (red != blue) and (green == 0) and (blue == 0)):
            lesion_with_border[i][c] = [0., 0., 0., 0.]      
   for i in range(0, lesion_with_border.shape[0]):
      for c in range(0, lesion_with_border.shape[1]):
         red = pix[i][c][2]
         green = pix[i][c][0]
         blue = pix[i][c][1]
         if(red == 0. and blue == 0. and green == 0.):
            lesion_with_border[i][c] = [0., 0., 0., 0.]
           
   min_x = coords[0][0]
   min_y = coords[0][1]
   max_x = coords[0][0]
   max_y = coords[0][1]
   for i in range(0, len(coords)):
      if(coords[i][0] < min_x):
         min_x = coords[i][0]
      if(coords[i][1] < min_y):
         min_y = coords[i][1]
      if(coords[i][0] > max_x):
         max_x = coords[i][0]
      if(coords[i][1] > max_y):
         max_y = coords[i][1]

   
   lesion_with_border = lesion_with_border[min_y:max_y,min_x:max_x]
   lesion_with_border = cv2.cvtColor(lesion_with_border, cv2.COLOR_RGBA2GRAY)
   cv2.imwrite("static/test2.png", lesion_with_border)
   return "static/test2.png"   
   
def load_model():
   json_file = open('../model.json', 'r')
   model_json = json_file.read()
   json_file.close()
   model = model_from_json(model_json)
   model.load_weights("../weights.h5")
   model.compile(loss='binary_crossentropy', optimizer='adam', metrics=['accuracy'])
   x = organize('static/test2.png')
   x = x.transpose(1,2,0)
   x = np.array([x])

   pred = model.predict(x)
   return pred

def save_model(): 
   json_file = open('../model.json', 'r')
   model_json = json_file.read()
   json_file.close()
   
   model = model_from_json(model_json)
   model.load_weights("../weights.h5")
   model.compile(loss='binary_crossentropy', optimizer='adam', metrics=['accuracy'])
   plot_model(model, to_file='model_visual.png', show_shapes=True)
   

   
